                        title="Password"
                        type="password"
                        value={password}
                        placeholder={ "Type your Password" }
                        onChnage={(e)=>{setPassowrd(e.target)}}
                    />
                </article>
                <Button 
                text="Join with Email"
                icon="material-symbols:login"
                className={styles.EmailBtn}
                handleclick={handleLogin}
                />
            </div>
  )
}

export default Signin
